import React from 'react';
import { NavLink } from 'react-router-dom';
import '../styles/Navbar.css';

const Navbar = () => {
    return (
        <nav className="navbar">
            <div className="navbar-title">Project Management</div>
            <ul className="navbar-links">
                <li><NavLink exact to="/" activeClassName="active">Dashboard</NavLink></li>
                <li><NavLink to="/projects" activeClassName="active">Projects</NavLink></li>
                <li><NavLink to="/tasks" activeClassName="active">Tasks</NavLink></li>
                <li><NavLink to="/team" activeClassName="active">Team</NavLink></li>
                <li><NavLink to="/calendar" activeClassName="active">Calendar</NavLink></li>
                <li><NavLink to="/settings" activeClassName="active">Settings</NavLink></li>
            </ul>
        </nav>
    );
};

export default Navbar;
